  ?entity wdt:P31 wd:Q5 ;
        wdt:P625 wd:San_Francisco .
  ?entity rdfs:label "San Francisco"@en ;
        wikibase:statementofquality ?property .
  FILTER(str(?property) = 'P625') .
  ?entity wdt:P468 ?nickname .
}

