         dbo:country "China" .

  OPTIONAL {
    ?river dbpedia-owl:length [dbo:maxValue ?length ] .

    FILTER (STRSTARTS(str(?length), "km"))
  }

  BIND(REPLACE(str(?river), " ", "") AS ?riverName)
}
LIMIT 1

