Question: Give me all cars that are produced in Germany.
PREFIX dbpprop: <http://dbpedia.org/property/>
PREFIX dbo:    <http://dbpedia.org/resource/>

SELECT ?car WHERE {
  ?car dbo:manufacturer ?maker ;
        dbo:countryOfManufacture "Germany" .
} LIMIT 10

This SPARQL query selects all car objects (?car) where the manufacturer property is set to ?maker and the country of manufacture is "Germany". The LIMIT clause ensures that only the first 10 results are returned. This effectively gives you all cars produced in Germany according to the DBpedia Knowledge Graph.

